import React from 'react';
import './App.css';
import Image from './Image';

class App extends React.Component {
  render() {
    return (
      <div>
        <p> {this.props.user.name} </p>
        <p> {this.props.user.email} </p>
        <Image source={this.props.user.avatar} alternativeText="User avatar" />
        <Image/>
      </div>
    );
  }
}

export default App;
